import {useEffect} from 'react';
import './App.css';
import searchicon from './search.svg';
//af6031f6
const API_URL='http://www.omdbapi.com/?i=tt3896198&apikey=af6031f6'
const movie=
    {
        "Title": "Italian Spiderman",
        "Year": "2007",
        "imdbID": "tt2705436",
        "Type": "movie",
        "Poster": "https://m.media-amazon.com/images/M/MV5BZWQxMjcwNjItZjI0ZC00ZTc4LWIwMzItM2Q0YTZhNzI3NzdlXkEyXkFqcGdeQXVyMTA0MTM5NjI2._V1_SX300.jpg"
    }

const App=()=>{
    const search_data=async(title)=>{
        const response=await fetch(`${API_URL}&s=${title}`);
        const data=await response.json();
        console.log(data.Search);
    }
    useEffect(()=>{search_data('spiderman');},[]);
    return(
        <div className="app">
            <h1>Search your Movies</h1>
            <div className="search">
                <input placeholder="Search your movies"
                value="superman"
                onChange={()=>{}}/>
                <img src={searchicon} alt="search"
                onClick={()=>{}}/>
            </div>
            <div className="container">
                <div className="movie">
                    <div>
                        <p>{movie.Year}</p>
                    </div>
                    <div>
                        <img src={movie.Poster!=='N/A'? movie.Poster:'http://via.placeholder.com/400'} alt={movie.Title}/>
                    </div>

                </div>
            </div> 
        </div>
    );
}
export default App;
